def get_keybord(arr):
    result = []

    if len(arr) > 6:
        result = [[KeyboardButton(text=text.exit_text)]]

    for i in range(0, len(arr), 2):
        if i + 1 < len(arr):
            result.append([KeyboardButton(text=arr[i]), KeyboardButton(text=arr[i+1])])
        else:
            result.append([KeyboardButton(text=arr[i])])

    result.append([KeyboardButton(text=text.exit_text)])

    return ReplyKeyboardMarkup(keyboard=result, resize_keyboard=True)


